import logo from './logo.svg';
import './App.css';
import Project from './Project';
import ImageSlider from './ImageSlider';
import Header from './Header/Header';
import Carousal from './components/Carousal';

const slides = [
  {url: "https://etimg.etb2bimg.com/photo/96331122.cms" ,title: "beach"  },
  { url: "https://hips.hearstapps.com/hmg-prod/images/different-types-of-dairy-products-royalty-free-image-1568741374.jpg?crop=0.696xw:1.00xh;0.224xw,0&resize=1200:*", title: "boat"  },
  { url: "http://localhost:3000/image-3.jpg", title: "forest" },
];
const containerStyles = {
  width: "500px",
  height: "280px",
  margin: "0 auto",
};
function App() {
  return (
    <div className="App">
      <Header></Header>
      <Carousal/>
      <div style={containerStyles}>
        <ImageSlider slides={slides} />
      </div>
    </div>
  );
}

export default App;
